query:
query GET_DEFAULT_EVENTS_LISTING($indices: [IndexType!], $aggregations: [ListingAggregationType!], $filters: [FilterInput], $pageSize: Int, $page: Int, $sortField: FilterSortFieldType, $sortOrder: FilterSortOrderType, $baseFilters: [FilterInput]) {
  listing(
    indices: $indices
    aggregations: []
    filters: $filters
    pageSize: $pageSize
    page: $page
    sortField: $sortField
    sortOrder: $sortOrder
  ) {
    data {
      ...eventFragment
      __typename
    }
    totalResults
    __typename
  }
  aggregations: listing(
    indices: $indices
    aggregations: $aggregations
    filters: $baseFilters
    pageSize: 0
    sortField: $sortField
    sortOrder: $sortOrder
  ) {
    aggregations {
      type
      values {
        value
        name
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment eventFragment on Event {
  id
  title
  interestedCount
  isSaved
  isInterested
  date
  startTime
  contentUrl
  queueItEnabled
  flyerFront
  newEventForm
  images {
    id
    filename
    alt
    type
    crop
    __typename
  }
  artists {
    id
    name
    __typename
  }
  venue {
    id
    name
    contentUrl
    live
    area {
      id
      name
      urlName
      country {
        id
        name
        urlCode
        __typename
      }
      __typename
    }
    __typename
  }
  pick {
    id
    blurb
    __typename
  }
  __typename
}
